import React, { Component } from 'react';

export default class Header extends Component {
    render() {
        return (
            <article class="Name" id="Home">
                <h1 data-aos="fade-right" data-aos-duration="1100">CHRISTOPHE DEMEY</h1>
                <h2 data-aos="fade-left" data-aos-duration="1100">MON PORTFOLIO</h2>
            </article>
        );
    }
}
